from typing import List
from itertools import product
from heapq import heappush, heappop, heapify

                
class SolutionTroll:
    def maximalRectangle(self, matrix: List[List[str]]) -> int:
        """n^6 solution?"""
        m = len(matrix)
        if m == 0:
            return 0
        n = len(matrix[0])
        if n == 0:
            return 0

        def check( il, jl, iu, ju):
            return all(matrix[k][l] == '1' 
                for k, l in product(range(il, iu), range(jl, ju)))

        dp = [[set()] * (n+1) for _ in range(m+1)]

        for i in range(m):
            for j in range(n):
                dp[i+1][j+1] = { 
                    (ii,jj) for ii, jj in product(range(i+1), range(j+1))
                        if check(ii, jj, i+1, j+1)
                }
 
        
        max_area = 0
        for i in range(m+1):
            for j in range(n+1):
                for (ii, jj) in dp[i][j]:
                    max_area = max(max_area, (i - ii) * (j - jj))

        return max_area
                
class Solution:
    def maximalRectangle(self, matrix: List[List[str]]) -> int:
        m = len(matrix)
        if m == 0:
            return 0
        n = len(matrix[0])
        if n == 0:
            return 0

        def build_run( di, dj, tag):
            run = [ [0 for _ in range(n+1)] for _ in range(m+1)]
            for i in range(m):
                for j in range(n):
                    run[i+1][j+1] = (1 + run[i+di][j+dj]) if matrix[i][j] == '1' else 0

            return run

        h_run = build_run(1, 0, "h run")
        v_run = build_run(0, 1, "v run")

        q = [(-area, (i,j)) for i,j in product(range(m+1),range(n+1)) if (area := h_run[i][j]*v_run[i][j]) > 0]
        heapify(q)
        max_area = 0

        count = 0
        count_updates = 0
        count_early = 0
        while q:
            _, (i,j) = heappop(q)
            count += 1
            h, v = h_run[i][j], v_run[i][j]

            if max_area >= h*v:
                break

            if h < v:
                min_v = None
                for hh in range(1,h+1):
                    vv = v_run[i][j-hh+1]
                    if min_v is None or min_v > vv:
                        min_v = vv
                    area = hh * min_v
                    if area > max_area:
                        max_area = area
                        count_updates += 1
                    if max_area >= h*min_v:
                        count_early += 1
                        break
            else:
                min_h = None
                for vv in range(1,v+1):
                    hh = h_run[i-vv+1][j]
                    if min_h is None or min_h > hh:
                        min_h = hh
                    area = vv * min_h
                    if area > max_area:
                        max_area = area
                        count_updates += 1
                    if max_area >= v*min_h:
                        count_early += 1
                        break

        print(f'Pops: {count} remaining: {len(q)} updates: {count_updates} early: {count_early}')

        return max_area


class SolutionCheat:
    def maximalRectangle(self, matrix):
        def hist(heights):
            stack, ans = [], 0
            for i, h in enumerate(heights + [0]):
                while stack and heights[stack[-1]] >= h:
                    H = heights[stack.pop()]
                    W = i if not stack else i-stack[-1]-1
                    ans = max(ans, H*W)
                stack.append(i)
            return ans
        
        if not matrix or not matrix[0]: return 0
        m, n, ans = len(matrix[0]), len(matrix), 0
        row = [0]*m
        for i in range(n):
            for j in range(m):
                row[j] = 0 if matrix[i][j] == "0" else row[j] + 1
            ans = max(ans, hist(row))
            
        return ans

